    <Box sx={{ minHeight: '100vh', padding: 2 }}>
      <Typography variant="h4" sx={{ mb: 4 }}>
        Riwayat Diagnosis
      </Typography>
      <Typography variant="body2">Belum ada riwayat.</Typography>
    </Box>
  );
}

export default History;
